import React, { Component } from 'react';
import Login from './components/login/Login';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router } from "react-router-dom";


class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <div className="App">
            <Login />
          </div>
        </div>
      </Router>
    );
  }
}

const routes = [
  {
    path: "/register",
    component: Register
  }
];



export default App;
